import { describe, test } from "node:test";
import { equal } from "node:assert/strict";

import repeatLimitedString from "2182.construct-string-with-repeat-limit";
import mock from "src/mocks/2182.mock";

describe("2182.", () => {
  test("case 1", () => {
    equal(repeatLimitedString(...mock[0]), "zzcccac");
  });

  test("case 2", () => {
    equal(repeatLimitedString(...mock[1]), "bbabaa");
  });

  test("case 38", () => {
    equal(repeatLimitedString(...mock[2]), "yxxrrrrqppliddd");
  });

  test("case 142", () => {
    equal(
      repeatLimitedString(...mock[3]),
      ""
    );
  });

  test("case 121", () => {
    equal(
      repeatLimitedString(...mock[4]),
      "zyzyzyxyxyxyxwxwxwxvxvxuxututststsrsrsrqrqrpopopopopopopononmnmlklkljljljijijijhghghghghfhfefefdfdfcfcbab"
    );
  });
});
